import styled from "styled-components";

export const InputContainer = styled.div`
    height:100vh;
    background: #000;
`

export const InputWrapper = styled.div`
    display:flex;
`

export const Form = styled.form`
    display: flex;
`

export const Input = styled.input`
border: 1px solid #E6343B; 
padding: 1em; 
width: 100%; 
`;
